from math import factorial


 def lol(n):
  if n == 1:
  yield [0]
  yield [1]
  else:
  for p in lol(n - 1):
  p.append(0)
  yield p
  p[-1] = 1
  yield p
  p.pop()


 def sp(g1, g2, g3, f):
  if g1 == 0:
  if g2 == g3:
  return 2
  elif abs(g2 - g3) == 1:
  return 1
  else:
  return 0
  elif g2 == 0:
  if g1 == g3:
  return 2
  elif abs(g1 - g3) == 1:
  return 1
  else:
  return 0
  elif g3 == 0:
  if g2 == g1:
  return 2
  elif abs(g2 - g1) == 1:
  return 1
  else:
  return 0
  else:
  if f == 1:
  b = sp(g1, g2 - 1, g3, 2)
  c = sp(g1, g2, g3 - 1, 3)
  return b + c
  elif f == 2:
  a = sp(g1 - 1, g2, g3, 1)
  c = sp(g1, g2, g3 - 1, 3)
  return a + c
  elif f == 3:
  a = sp(g1 - 1, g2, g3, 1)
  b = sp(g1, g2 - 1, g3, 2)
  return a + b
  else:
  a = sp(g1 - 1, g2, g3, 1)
  b = sp(g1, g2 - 1, g3, 2)
  c = sp(g1, g2, g3 - 1, 3)
  return a + b + c


